import React from "react";

const e = React.createElement;
const consoleStyle = {
  width: "100%",
  height: 510,
  resize: "none",
  outline: "none"
};

class Console extends React.Component {

  componentWillReceiveProps(props){
      console.log('props received',props);
  }  
  renderLines() {
    return this.props.console.join("\n");
  }

  render() {
    return e("textarea", {
      onChange: this.props.consoleValueChanged,
      style: consoleStyle,
      defaultValue: this.renderLines()
    });
  }
}

export default Console;
